/**
 * Finds the key in conf files and returns the corresponding value
 *
 * @param {string} key Key to find
 * @returns {string|null} Value of the key
 */
const getConfValue = (key) => {
    // find the line that contains the key (exact match)
    const matchedLine = readEnvVars().find((/** @type {string} */ line) => line.split("=")[0] === key);

    // split the line (delimiter is '=') and return the item at index 2
    return matchedLine !== undefined ? matchedLine.split("=")[1] : null;
};


let k;

for (k of Object.keys(config)) {
    let confVal = getConfValue(k)
    if (confVal) {
        config[k] = confVal
    }
}

configs[msg.filename] = config
flow.set("configs", configs)

msg.payload = config;

return msg;

